import React, { useEffect , useState } from 'react'
import {  Link, useNavigate } from "react-router-dom";
import Connection from '../components/Services/Connection' 
const JoinUs= () => {
    let navigate=useNavigate()
    const [name, SetName] = useState('')
    const [address, SetAddress] = useState('')
    const [pincode, SetPincode] = useState('')
    const [dob, SetDob] = useState('')
    const [aadhaar, SetAadhaar] = useState('')
    const [charge, SetCharge] = useState('')
    const [mobile, SetMobile] = useState('')   
    const [username, SetUsername] = useState('')
    const [service, SetService] = useState('')
   
    const SaveUser=(e)=>{
        e.preventDefault();
        service=1
        const supplier={name,address,pincode,dob,aadhaar,mobile,username,service,charge}
        Connection.saveSupplier(customer).then((response)=>{         
        if(response.data.userid!=0)
        {
       
       const tok= response.data.token;
        navigate('/verify',
        {
            state: {
                token: tok,
                 }
        });
        } 
            
      } ).catch(error =>{navigate("/")})}


  return (
    

    <div>
      
     <div>
          
<div className="container col-8 mt-5 mb-5">
          
             
<div className='card text-bg-light p-3 '>
                  <form>
                  <h3 className='text-center'>Supplier SignUp Form</h3>
                      <div className="form-group mb-2">
                          <label className="form-label mt-4">Name</label>
                          <input type="text" 
                          placeholder="Enter Full Name" 
                          name="name"
                          value={name}
                          onChange={(e)=>SetName(e.target.value)} 
                          className="form-control rounded-pill mt-2" 
                          required></input>
                      </div>

                      <div className="form-group mb-2">
                          <label className="form-label mt-4">Email</label>
                          <input type="Email" 
                          placeholder="This will be your Username" 
                          name="username" 
                          value={username}
                          onChange={(e)=>SetUsername(e.target.value)}
                          className="form-control rounded-pill mt-2" 
                          required></input>
                          <label className=""><small>OTP will be sent on this email</small></label>
                      </div>

                      <div className="form-group mb-2">
                          <label className="form-label mt-4">Mobile No.</label>
                          <input type="number" 
                          placeholder="Enter Mobile" 
                          name="mobile" 
                          value={mobile}
                          onChange={(e)=>SetMobile(e.target.value)}
                          className="form-control rounded-pill mt-2" 
                          required></input>
                      </div>
                      <div className="form-group mb-2">
                          <label className="form-label mt-4">Aadhaar Number</label>
                          <input type="number" 
                          placeholder="Enter Aadhaar No." 
                          name="aadhaar" 
                          value={aadhaar}
                          onChange={(e)=>SetAadhaar(e.target.value)} 
                          className="form-control rounded-pill mt-2" 
                          required></input>
                      </div>
                      


                      <div className="form-group mb-2">
                          <label className="form-label mt-4">Address</label>
                          <input type="text" 
                          placeholder="Enter Address" 
                          name="address" 
                          value={address}
                          onChange={(e)=>SetAddress(e.target.value)}
                          className="form-control rounded-pill mt-2" 
                          required></input>
                      </div>

                      

                      <div className="form-group mb-2">
                          <label className="form-label mt-4">Zip Code</label>
                          <input type="number" 
                          placeholder="Enter PinCode" 
                          name="pincode" 
                          value={pincode}
                          onChange={(e)=>SetPincode(e.target.value)}
                          className="form-control rounded-pill mt-2" 
                          required></input>
                         
                      </div>

                      <div className="form-group mb-2">
                          <label className="form-label mt-4">DOB</label>
                          <input type="date" 
                          placeholder="Enter DOB" 
                          name="dob" 
                          value={dob}
                          onChange={(e)=>SetDob(e.target.value)}
                          className="form-control rounded-pill mt-2" 
                          required></input>
                      </div>

                      <div className="form-group mb-2">
                          <label className="form-label mt-4">Minimum Visit Charges</label>
                          <input type="number" 
                          placeholder="Enter visit charges" 
                          name="charge" 
                          value={charge}
                          onChange={(e)=>SetCharge(e.target.value)} 
                          className="form-control rounded-pill mt-2" 
                          required></input>
                      </div>
                      

                      <div className="form-group mb-2">
                          <label className="form-label mt-4">Service Type</label>&nbsp;&nbsp;

                          <select  name="service"
                        //  value={service}
                         // onChange={(e)=>SetService(e.target.value)}
                          >
                          <option selected disabled >Select Option</option>
                          <option value={1}>Plumbing</option>
                          <option >Electrician</option>
                           <option >Furniture</option>
                          <option >AC/TV Repair</option>
                          <option >Painting</option>
                          <option >Interior Design</option>
                           <option >Furniture</option>
                          <option >Fabrication</option>
                          </select>
                      </div>
                     


                     
                    

                     <div className='d-grid gap-2'>
                      <button className="btn btn-primary mt-4 rounded-pill" onClick={(e)=>SaveUser(e)}>Get OTP</button>
                      </div>


                  </form>
              
                  <div className='d-grid gap-2'>
                      <button className="btn btn-success mt-4 rounded-pill" >SignIn</button>
                      </div>
         
      </div>
      </div>

    </div>
  
    </div>
  )
}

export default JoinUs
